import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import ProjectCard from "../assets/images/project-card.png";

export default function Clients() {
  return (
    <section className="py-5 position-relative">
      <small
        className="artboard-text position-absolute text-uppercase top-30 fw-bold"
        style={{
          left: "30px",
          color: "#ff6442",
          letterSpacing: "5px",
          transform: "rotate(-90deg)",
        }}
      >
        our clients
      </small>
      <Container>
        <Row>
          <Col lg={12} className="text-center">
            <p className="main-title">Who we've worked with:</p>
          </Col>
        </Row>
        <Row className="">
          <Col lg={8} className="d-flex flex-wrap mx-auto">
            {clientCardContents.map((content, i) => (
              <Card className="client-card" key={i}>
                <Card.Img
                  variant="top"
                  className="img-fluid"
                  src={content.image}
                />
              </Card>
            ))}
          </Col>
        </Row>
      </Container>
    </section>
  );
}

const clientCardContents = [
  {
    image: ProjectCard,
  },
  {
    image: ProjectCard,
  },
  {
    image: ProjectCard,
  },
